Journey back to the 70s AD and lead the construction of the iconic arena in this monumental challenge. Break ground on the building site, construct quarries, and improve roads as you witness the structure rise from the ground. Build the majestic amphitheater from bare dirt and heavy stone, create competitive working conditions for your workers, and meet key objectives. With 50 levels of play to complete and tons of unlockable bonuses, Monument Builders - Colosseum is your best chance to ensure your name goes down in history.
